import React from 'react';
import Button from '@mui/material/Button';
import { alpha, styled } from '@mui/material/styles';


// const LongButton = styled(Button)({
//     color: 'white',
//     backgroundColor: 'black',
//     padding: 8,
//     borderRadius: 4,
//   });

const LongButtonCustomized = styled(Button) ((text) => {
    return (
        <>
            {/* <LongButton default="Hello"></LongButton> */}
            <Button
                defaultValue = "Your mom"
                sx={{
                    width: 100,
                    color: "white",
                    backgroundolor: "black"
                }}>
                {text}
            </Button>
        </>
    );
});

export default LongButtonCustomized;
